import React from 'react'
import StoryReel from './StoryReel';
import MessageSender from './MessageSender';
import Post from './Post'
import './Feed.css'

function Feed() {
    return (
        <div className='feed'>
            <StoryReel/>
            <MessageSender/>
            <Post
             
            profilePic=' https://pngimg.com/uploads/google/google_PNG19644.png'
            message='it works'
            timestamp='2020'
            username='757ALi'
            image='https://p.kindpng.com/picc/s/21-210466_google-png-free-pic-logo-google-con-lupa.png'
            
            />
             
             


        </div>
    )
}

export default Feed;
